import React from 'react';
import PropTypes from "prop-types";

const foodILike = [
  {
    id: 1,
    name: "kimchi",
    image: "data:image/jpeg;base64,",
    rating: 4.2
  },
  {
    id: 2,
    name: "lamen",
    image: "data:image/jpeg;base64,",
    rating: 4.4
  },
  {
    id: 3,
    name: "치킨",
    image: "https://img.bbq.co.kr:449/uploads/bbq_d/pc/surpride_thumb_N.png",
    rating: 4.5
  },
  {
    id: 4,
    name: "스시",
    image: "data:image/jpeg;base64,",
    rating: 4.1
  }
];

function Food({name, picture, rating}) {
  return (
    <div>
      <h2>I like {name}</h2>
      <h4>{rating} / 5.0</h4>
      <img src={picture} alt={name}/>
    </div>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number
};

function App() {
  return (
    <div>
      {foodILike.map(dish => (
        <Food
          key={dish.id}
          name={dish.name}
          picture={dish.image}
          rating={dish.rating}
        />
      ))}
    </div>
  );
}

export default App;
